import React, {Component} from 'react';

class Detail extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        const {items} = this.props
        return (
            <React.Fragment>
                <div>{items.date}</div>
                <div>{items.content}</div>
            </React.Fragment>
        );
    }
}

export default Detail
